import React, { Component } from 'react';
import { Modal, Button, Icon, Tabs, List } from 'antd';
import style from './style.css'
import mapImg from '../img/map.png'

class Report extends Component {
  constructor(props) {
    super(props);
    this.state = {};

    this.fetchAPI = this.fetchAPI.bind(this);
    this.onloading = this.onloading.bind(this);
    this.mapClick = this.mapClick.bind(this);
  }

  async componentWillMount() {
    const modal = this.onloading();
    console.log(this.props.location.state.inputValue)
    const result_data = await this.fetchAPI(this.props.location.state.inputValue)
    this.setState({
      d:result_data
    })
    modal.destroy();
    console.log(this.state)
  }

  async fetchAPI(inputUrl) {
    let _data = '';
    const data = await fetch(`/verification?url=${inputUrl}`)
      .then(response => response.json())
      .then(data => {
        console.log(data);
        _data = data;
      })
      return _data;
  }

  mapClick() {
    this.props.history.push({ pathname:'/maps', state:this.state })
  }

  // 等待验证数据返回的modal
  onloading() {
    let modal = '';
    modal = Modal.success({
      title: '正在验证',
      content: '请稍后',
    });
    return modal
  }

  render() {
    const TabPane = Tabs.TabPane;
    return (
      <div id="report">
        {
          this.state.d ? (
              this.state.d.virusTotal_message.code == -1 ? (
                  <div>
                    <p>ip:查询不到</p>
                    <p>ip:{this.state.d.virusTotal_message.message}</p>
                  </div>
                ):(
                  <div className={style.detection}>
                    <div className={style.headerInfo}>
                      <div className={style.icon}>
                        <Icon type="global" style={{ fontSize: 100, color: '#08c' }}/>
                      </div>
                      <div className={style.iconStr}>
                        <span className={style.deteNum}>共有{this.state.d.virusTotal_message.danger_sum}个检测引擎检测到此网站</span>
                        <br/>
                        <span className={style.deteTag}>网址</span>
                        <span>{this.state.d.virusTotal_message.url}</span>
                        <br/>
                        <span className={style.deteTag}>网站状态</span>
                        <span>{this.state.d.virusTotal_message.state? (<span>安全</span>) : (<span>危险</span>)}</span>
                        <br/>
                        <span className={style.deteTag}>网站ip</span>
                        <span>{this.state.d.ip}</span>
                        <br/>
                        <span className={style.deteTag}>最近的检测时间</span>
                        <span>{this.state.d.virusTotal_message.scan_date}</span>
                        <br/>
                      </div>
                    </div>
                    <div className={style.map} onClick={this.mapClick}>
                      <span className={style.mapInfo}>查看热点地图</span>
                      <img className={style.mapImg} src="data:image/png;base64," alt=""/>
                    </div>
                    {/*<p>网站状态</p>
                    <p>检测过的软件个数:{this.state.d.virusTotal_message.software_sum}</p>
                    <p>检测为危险的软件个数:{this.state.d.virusTotal_message.danger_sum}</p>
                    <p>检测为安全的软件个数:{this.state.d.virusTotal_message.security_sum}</p>
                    <ul>
                      <p>检测为危险的软件列表:{this.state.d.virusTotal_message.danger_software.map((i) => <li key={i}>{i}</li>)}</p>
                    </ul>
                    <ul>
                      <p>检测为安全的软件列表:{this.state.d.virusTotal_message.security_software.map((i) => <li key={i}>{i}</li>)}</p>
                    </ul>*/}
                    <Tabs  className={style.tabTitle} defaultActiveKey="1" tabPosition="top">
                        <TabPane className={style.tabContent} tab={<span><Icon type="check-square-o" style={{ fontSize: 15, color: '#62bb53' }}/>检测为安全的引擎</span>} key="1">
                          <div className={style.listDiv}>
                            {this.state.d.virusTotal_message.security_software.map((i) => 
                              <li className={style.list} key={i}>
                                <span className={style.listContent}>{i}</span>
                                <span>
                                <Icon type="check" style={{ fontSize: 22, color: '#62bb53' }}  />
                                </span>
                              </li>)}
                          </div>
                        </TabPane>
                        <TabPane className={style.tabContent} tab={<span><Icon type="close-square-o" style={{ fontSize: 15, color: '#d74948' }}/>检测为危险的引擎</span>} key="2">
                          <div className={style.listDiv}>
                            {this.state.d.virusTotal_message.danger_software.map((i) => 
                              <li className={style.list} key={i}>
                                <span className={style.listContent}>{i}</span>
                                <span>
                                <Icon type="close"  style={{ fontSize: 22, color: '#d74948' }}/>
                                </span>
                              </li>)}
                          </div>
                        </TabPane>
                    </Tabs>
                  </div>
                )
            ): (
              <h1>
                正在验证
              </h1>
            )
        }
      </div>
    );
  }
}

export default Report;